import * as React from 'react';
import {AppBar, Button, Menu} from "@mui/material";



function NavBar() {
  

  return (
   
<AppBar sx={{
  position :"fixed",
  top:"1.5%",
    zIndex: "11",
    backgroundColor:"#341f97",
    width:"90vw",
    height:"6ch",
    borderRadius:"20px",
    right:"auto",
   }} id = "navbar">

    <div id = "buttonContainer">
      <Button>buton</Button>
      <Menu>Buton meniu</Menu>
    </div>

   </AppBar>
   
  );
}
export default NavBar;
